create database healthSystem;
use healthSystem;

CREATE TABLE `Pacientes` (
  `id` integer PRIMARY KEY,
  `nombre` varchar(255),
  `fecha_nacimiento` date,
  `direccion` varchar(255),
  `id_contacto` integer,
  `created_at` timestamp,
  `updated_at` timestamp,
  `disabled_at` timestamp
);

CREATE TABLE `Profesionales_de_Salud` (
  `id` integer PRIMARY KEY,
  `nombre` varchar(255),
  `apellido` varchar(255),
  `id_contacto` integer,
  `id_especialidad` integer,
  `disponibilidad` text,
  `created_at` timestamp,
  `updated_at` timestamp,
  `disabled_at` timestamp
);

CREATE TABLE `Especialidades` (
  `id` integer PRIMARY KEY,
  `nombre` varchar(255),
  `descripcion` text,
  `created_at` timestamp,
  `updated_at` timestamp,
  `disabled_at` timestamp
);

CREATE TABLE `Citas` (
  `id` integer PRIMARY KEY,
  `id_paciente` integer,
  `id_profesional` integer,
  `id_centro` integer,
  `fecha` timestamp,
  `id_motivo` integer,
  `created_at` timestamp,
  `updated_at` timestamp,
  `disabled_at` timestamp
);

CREATE TABLE `Motivos` (
  `id` integer PRIMARY KEY,
  `descripcion` text,
  `created_at` timestamp,
  `updated_at` timestamp,
  `disabled_at` timestamp
);

CREATE TABLE `Localidades` (
  `id` integer PRIMARY KEY,
  `nombre` varchar(255),
  `codigo_postal` varchar(255),
  `created_at` timestamp,
  `updated_at` timestamp,
  `disabled_at` timestamp
);

CREATE TABLE `Centros_de_Salud` (
  `id` integer PRIMARY KEY,
  `nombre` varchar(255),
  `direccion` varchar(255),
  `id_localidad` integer,
  `id_contacto` integer,
  `created_at` timestamp,
  `updated_at` timestamp,
  `disabled_at` timestamp
);

CREATE TABLE `Contactos` (
  `id` integer PRIMARY KEY,
  `telefono` varchar(255),
  `email` varchar(255),
  `created_at` timestamp,
  `updated_at` timestamp,
  `disabled_at` timestamp
);

ALTER TABLE `Profesionales_de_Salud` ADD FOREIGN KEY (`id_especialidad`) REFERENCES `Especialidades` (`id`);

ALTER TABLE `Profesionales_de_Salud` ADD FOREIGN KEY (`id_contacto`) REFERENCES `Contactos` (`id`);

ALTER TABLE `Pacientes` ADD FOREIGN KEY (`id_contacto`) REFERENCES `Contactos` (`id`);

ALTER TABLE `Citas` ADD FOREIGN KEY (`id_paciente`) REFERENCES `Pacientes` (`id`);

ALTER TABLE `Citas` ADD FOREIGN KEY (`id_profesional`) REFERENCES `Profesionales_de_Salud` (`id`);

ALTER TABLE `Citas` ADD FOREIGN KEY (`id_centro`) REFERENCES `Centros_de_Salud` (`id`);

ALTER TABLE `Citas` ADD FOREIGN KEY (`id_motivo`) REFERENCES `Motivos` (`id`);

ALTER TABLE `Centros_de_Salud` ADD FOREIGN KEY (`id_localidad`) REFERENCES `Localidades` (`id`);

ALTER TABLE `Centros_de_Salud` ADD FOREIGN KEY (`id_contacto`) REFERENCES `Contactos` (`id`);












